fin = open('alice_in_wonderland.txt')
lines = fin.readlines()
fin.close()

count = 0
for line in lines:
    count += 1
print(f'The book contains {count} lines')

import string

stmt = "Hi there, nice to meet you."
words = stmt.split()
for word in words:
    print(word.strip(string.punctuation))

wordCount = 0
for line in lines:
    words = line.split()
    for word in words:
        word = word.strip(string.punctuation)
        if len(word) > 0:
            wordCount += 1

print(f'Alice in Wonderland contains {wordCount} words.')


